column5:
sauf combustibles (bois de chauffage, tourbe, charbon de bois), en 3; pigments et colorants y compris naturels bruts, en 5;
y compris
- bois bruts sciés ou non sans aucune mention de façonnage ou de calibrage, uniquement présentés comme "bois" de quelque chose ou de quelque part sciés ou en bûches, autrement classés en 6b (y compris tous les "bois pour...", supposés triés et calibrés et donc en 6b);
- bambou, rotin;
- graines et fruits oleagineux avant transformation, graines semences même de produits comestibles, plantes entières ou en partie y compris fleurs, racines, feuilles, résines et gommes,à usage non comestible (usage médicinal, pour les manufactures, etc.); sauf produits colorants et teinturiers même naturels, classés en 5;
- toute fibre textile brute non filée ou tissée (soie ou filoselle, coton, jute, lin, chanvre, laine...) qu'elle soit animale ou végétale, même avec première transformation (cardage ou peignage, par exemple);
- cuirs et peaux explicitement bruts ("vertes", "crues", "en poil" ou "fourrure"); en cas de doute ou d'indication contradictoire, classer en 6a;
- tous déchets de matières organiques (fumier, cendre hors cendres à teintures signalées par une couleur...); également déchets de tissus (chiffons, friperie);
- toute pierre, sable ou minéral bruts (craie, soufre, bitume, pyrite de fer, etc.), y compris en poudre ou en solution, y compris plâtre, y compris  le sel commun NaCl (mais non raffinés:  "sels" autres que NaCl supposés raffinés, et donc mis en 5), sauf pierre taillée ou travaillée, classée en 6k (en cas de présence d'un qualificatif et doute sur le caractère ouvré, rester en 2); tout déchet minéral (dérivés de la fabrication du fer ou de l'acier, par ex.), et sauf produits colorants et teinturiers; en cas de doute sur une éventuelle nature composée ou teinturière (produit utilisé non précisé, comme dans les "poudres" diverses), classer en 5
- os, corne, ivoire, écaille, ambre, coquillage, nacre non transformés en objet (si qualificatif "monté" ou "travaillé", renvoyer en 8)
- animaux ou parties d'animaux à usage non comestible, hors bêtes de somme, non travaillées (y compris destinées aux manufactures, mais hors colorants et teintures, rejetés en 5; si qualificatif "monté" ou "travaillé", renvoyer en 8)

Produits chimiques ou apparentés ayant subi au moins une transformation (dans le doute, en 2, sauf pour les teintures/colorants).
Y compris 
- alcools non comestibles; 
- sels divers minéraux ou végétaux, transformés (composés ou raffinés, mais pas seulement produits bruts broyés ou en solution non qualifiés de "sels", en ce cas laissés en 2); en cas de doute sur le degré de transformation du minéral ou végétal d'origine ("poudre d'étain" plutôt que "sel d'étain", par ex.), mettre en 2; si présence d'une indication autre que d'origine ou de produit brut, tendant à indiquer un composé ou une utilisation médicinale ou tinctoriale, laisser en 5;
- médicaments de tous type impliquant au moins une opération de transformation (dans le doute, retour en 2); également sang et fluides organiques clairement signalés comme à but thérapeutiue et non alimentaire (là encore, dans le doute retour en 2);
- encres, peintures et colorants, vernis, colles, y compris les colorants et pigments naturels transformés ou bruts (dans le doute sur la fonction tinctoriale, classer en 2) et les bois signalés comme de teinture ou traités pour l'utilisation en teinture ou en médecine (hachés, moulus, râpés...);
- parfums, essences, eaux, extraits, huiles, poudres et sels au statut incertain, sans indication de produit brut utilisé pour les confectionner, et pouvant servir à l'artisanat, la médecine ou la parfurmerie, y compris les eaux minérales et les extraits purifiés de plantes;
- savons, produits de nettoyage;
- poudres, explosifs.

Tout produit de la métallurgie hors métal brut sous forme de minerai, poudre ou solution (rejetés en 2), et tout objet manufacturé de fer, cuivre ou tout autre métal (hors tonnellerie, en 6b et moyens de transport, en 7), y compris: 
- lingots, grenaille, plaques, feuilles, tôles, barres, tiges, fils, tubes, tuyaux, poudres de métal;
- couteaux, y compris quand la matière n'est pas précisée;
- vaiselle, récipients, caisses, cuves hors chaudières et sanitaires, clés, objets ménagers en métal hors meubles, objets d'art (cuivre gravé ou en bas-relief, e.g.), étuis, boîtes, coffres, renvoyés en 8.;
- visserie, aiguilles, épingles, et tous outils à main, y compris outils en bois ou en matière non métallique, y compris moules et formes pour artisans (mais pas machines agricolespi autres ni outils employés dans la marine, en 7; ni filets de pêche, en 6h; ni outils de pêche à la ligne, instruments de précision, balais, brosses, pinceaux, établis et tables de travail, tamis, chaudières, en 8)

Y compris:
- terres cuites: matériaux de construction (briques, carreaux, etc.), poterie (y compris bouteilles entourées de tissus ou d'osier), vaisselle, porcelaine, céramique; également chaux, ciment; mias vaisselle et autres en or, argent, matières précieuses ou semi-précieuses rejetées en 8;
- verrerie: vaiselle (y compris bouteilles entourées de tissus ou d'osier), miroirs sans mention d'encadrement (si encadrés, en 8), vitres;
- vaisselle, verres, bouteilles, pots, etc. sans indication de composition;
- pierres précieuses et semi-précieuses sans mention de monture;
- pierres taillées, meules, statues hors marbre et albâtre sculpté ou travaillé, en 8

Tout ce qui reste ou est exclu des précédents, y compris:
- chaudières, sanitaires;
- lampes;
- meubles de tous types, y compris parures de meubles et éléments de meubles, parures de lit ou lingerie sans précision sur leur nature (sinon en 6; "drap de satin" en 6i, "lit de satin" en 8), y compris nappes, serviettes, etc.; sauf tapis et tapisserie rejetés en filés/tissés ;
- tout sac de voyage, malle, nécessaire, gaine, étui, poudrier, tabatière, boîte, bourse, porte-monnaie, etc.;
- tous vêtements et chaussures;
- accessoires de vêtements: mouchoirs, châles, cravates, bas, chapeaux, boutons, perruques, peignes, etc., hors rubanerie et passementerie (rubans, ganses, cordons et cordonnets, tresses, lacets en tissu, galons, "agréments",  etc., y compris en partie d'or et d'argent) rejetée dans les catégories en 6 et lacets en cuir, rejetés en 6a;
- instruments scientifiques y compris médecine, balances, boussoles, horlogerie, lunettes;
- matériel d'écriture (hors papier et encre);
- armes et munitions;
- imprimés (finis et pas à remplir, cf. 6c), jeux et jouets, matériel d'écriture;
- objets précieux, objets d'art et de collection, bijouterie, joaillerie y compris métaux précieux ouvragés en fils, en réseau ou tissé (dentelle, franges...) ou ouvrages dorés ou argentés sans précision d'autre matériau, mais hors pierres seules, en 6k, et dentelle/rubanerie/passementerie d'or et d'argent si mêlé ou qualificatif  "dorure", "doré", "mêlé", "faux", etc., rejetés en 6i;
- instruments de musique;
- jeux et jouets, outils de pêche à la ligne;
- os, corne, ivoire, écaille, ambre, coquillage, nacre ou parties d'animaux travaillés ou transformés;
- varia: bougies, allumettes (et par extension mèches dont la composition est inconnue), pipes, parapluies, cannes, fouets;
- balais, brosses, pinceaux, houppes
- tamis 
- nattes, ouvrages de vannerie explicitement décrits (si osier, jonc, etc., seulement signalé comme ouvré ou travaillé sans précision sur l'objet produit, rejeté en 6b)
